import React from 'react'
import { connect } from 'react-redux'

let ProductsList = (props) => {
    console.log(props);
    props.map((item, index) => {
        return (
            <div key={`${index}`}>
                {item} />
             </div>
        )
    })

    return (
        <div>
            {props.product[0]}
        </div>
    )
}

const mapStateToProps = (state) => ({
    product: state.products
})

export default connect(
    mapStateToProps,
    null
)(ProductsList)
